-- cleanup

drop table if exists matches;
drop table if exists signedwith;
drop table if exists players;
drop table if exists seasons;
drop table if exists clubs;
drop table if exists cities;

-- DDL

create table cities (
  ID integer primary key,
  name varchar not null
);

create table clubs (
  ID integer primary key,
  name varchar not null,
  cityID integer not null references cities(ID)
);

create table seasons (
  ID integer primary key,
  startdate date not null,
  enddate date not null
);

create table players (
  ID integer primary key,
  name varchar not null
);

create table signedwith (
  playerID integer references players(ID),
  clubID integer,
  seasonID integer references seasons(ID),
  primary key (playerID, seasonID)
);

create table matches (
  homeID integer references clubs(ID),
  awayID integer references clubs(ID),
  seasonID integer references seasons(ID),
  homegoals integer not null,
  awaygoals integer not null,
  awaywin boolean not null,
  primary key (homeID, awayID, seasonID)
);

SET datestyle = "ISO, DMY";

-- dataq
update matches set awaywin = false, awaygoals = 0, homegoals = 0 where homeID = 9 and awayID = 1 and seasonID = 2026;
update matches set awaywin = false, awaygoals = 0, homegoals = 0 where homeID = 9 and awayID = 1 and seasonID = 2031;
update matches set awaywin = true, awaygoals = 6, homegoals = 0 where awayID = 2 and homeID = 16 and seasonID = 2036;
update matches set awaywin = true, awaygoals = 4, homegoals = 0 where awayID = 20 and homeID = 16 and seasonID = 2044;
